var ioNesAudio = {
	context: null,
	
	initialize: function()
	{
		ioNesAudio.wave = new RIFFWAVE();				// create an empty wave file
		ioNesAudio.wave.header.sampleRate = 44100;		// set sample rate to 44KHz
		ioNesAudio.wave.header.numChannels = 2;			// two channels (stereo)
		ioNesAudio.wave.header.bitsPerSample = 16;		// two channels (stereo)
		
		if ('AudioContext' in window) {
			ioNesAudio.context = new AudioContext();
		} else if ('webkitAudioContext' in window) {
			ioNesAudio.context = new webkitAudioContext();
		}
		
		nes.ui.writeAudio = ioNesAudio.writeAudio;		// Redirect audio data to our audio helper
	},
	
	toggle: function()
	{
		if( ioNesAudio.context == null )
		{
			return false;
		}
		nes.opts.emulateSound = !nes.opts.emulateSound;
		
		if( nes.opts.emulateSound )
		{
			var sound = "";
			play( sound );
		}
	},
	
	writeAudio: function( samples ){
		
		ioNesAudio.wave.Make( samples );					// make the wave file
		play( ioNesAudio.wave.dataURI.replace( 'data:audio/wav;base64,', '' ) );
	}
}


//
var myAudioContext, mySource, myBuffer;

if ('AudioContext' in window) {
	myAudioContext = new AudioContext();
} else if ('webkitAudioContext' in window) {
	myAudioContext = new webkitAudioContext();
}

function play ( sound ) {
	var arrayBuff = Base64Binary.decodeArrayBuffer(sound);

	ioNesAudio.context.decodeAudioData(arrayBuff, function(audioData) {
		myBuffer = audioData;
	});
	
	mySource = ioNesAudio.context.createBufferSource();
	mySource.buffer = myBuffer;
	mySource.connect(ioNesAudio.context.destination);

	if ('AudioContext' in window) {
		mySource.start(0);
	} else if ('webkitAudioContext' in window) {
		mySource.noteOn(0);
	} 
}